import React, { Component }  from 'react';
import {connect} from 'react-redux'


class Details extends Component {

    render(){
        return (
            <div>
                {console.log(this.props.data)}
            </div>
        )
    }
}

const mapStateToProps  = (state) => ({
    data: state.product,
})

export default connect(mapStateToProps, {})(Details)
